  def test_L3FormulaFormatter_collapseMinus(self):
    n = libsbml.ASTNode()
    c = libsbml.ASTNode()
    c2 = libsbml.ASTNode()
    c3 = libsbml.ASTNode()
    c4 = libsbml.ASTNode()
    l3ps = libsbml.L3ParserSettings()
    n.setType(libsbml.AST_MINUS)
    c.setType(libsbml.AST_MINUS)
    n.addChild(c)
    c2.setType(libsbml.AST_MINUS)
    c.addChild(c2)
    c3.setType(libsbml.AST_MINUS)
    c2.addChild(c3)
    c4.setName( "x")
    c3.addChild(c4)
    s = n.formulaToL3StringWithSettings(l3ps)
    self.assertTrue((  "----x" == s ))
    l3ps.setParseCollapseMinus(0)
    s = n.formulaToL3StringWithSettings(l3ps)
    self.assertTrue((  "----x" == s ))
    l3ps.setParseCollapseMinus(1)
    s = n.formulaToL3StringWithSettings(l3ps)
    self.assertTrue((  "x" == s ))
    _dummyList = [ n ]; _dummyList[:] = []; del _dummyList
    _dummyList = [ l3ps ]; _dummyList[:] = []; del _dummyList
    pass  

